</ul></div></nav>	<div class="hero" style="background-image:url(/9d7da164a49349e469470d197a39bd5e.jpg);">
		<div class="wrap">
			<div class="hero-container">
					<div class="page-title">
		<h1>Give Back</h1>
	</div>
		<div class="page-description">
		<p>At SMP we are committed to our community and we actively participate and recruit involvement in these worthy organizations.</p>
	</div>
				</div>
		</div>
	</div>
	<div class="site-inner"><div class="wrap"><div class="content-sidebar-wrap"><main class="content"><article class="post-20 page type-page status-publish entry" aria-label="Give Back" itemscope="" itemtype="https://schema.org/CreativeWork"><header class="entry-header"></header><div class="entry-content" itemprop="text"><p><strong>Touch Care Give Volunteer:</strong> At Smart Merchant Processing we are passionate about doing whatever we can to make things better for others. SMP’s founder has committed to give of his resources and time to organizations he believes are making a difference in our community and the world we live in. Below are a few of the organizations we support and ask that you learn more about and encourage you to do whatever your heart moves you to do. Alex and the SMP family thank you in advance for your support.</p>
</div></article>	<div class="charities">
			<div class="charity">
			<div class="image-container" style="background-image:url(/f873ddba6e25d185f4658472b992a02b.png);">
			</div>
			<div class="content-container">
				<p>As a former Vice Chair of the Miami Foundation Alex has firsthand knowledge of the effort and commitment this organization has to support and fund organizations and individuals throughout Miami. Please click on the link below and learn more about the Miami Foundation and all the wonderful things it has, is, and will continue to do in “The Magic City”. Please visit: http://miamifoundation.org</p>
			</div>
		</div>
			<div class="charity">
			<div class="image-container" style="background-image:url(/91a2facd9b62168e7e2128beaa1ee84e.png);">
			</div>
			<div class="content-container">
				<p>Please help me support the efforts of all those involved in Dibia Dream. I encourage you to learn about what this wonderful organization is doing for youth in Miami, New Orleans, and other parts of the US and Caribbean. Brandon Okpalobi Dream’s founder is passionate about bettering the lives of the young people his organization interacts with. Please visit: http://dibiadream.org</p>
			</div>
		</div>
			<div class="charity">
			<div class="image-container" style="background-image:url(/9876129bfa642cfc000141291245408b.png);">
			</div>
			<div class="content-container">
				<p>Please join SMP in support of SBP. This organization was founded by two high school sophomores that saw a need and decided to do something about it. Their entrepreneurial drive and passion for their city is refreshing . I hope that after you learn more about the String Bag Project and the young people running it you will do like we have and support these young leaders. Please visit: http://stringbagproject.com</p>
			</div>
		</div>
			<div class="charity">
			<div class="image-container" style="background-image:url(/de12a4126a3db827596b292ca68b12eb.png);">
			</div>
			<div class="content-container">
				<p>One of the best ways we can make our communities better is through the education of our youth. Dr. Lewis and her staff are dedicated to bettering the lives of the children that come through their doors everyday by providing them healthy meals, education, and exposing them to things at an early age that will equip them to be the future leaders of Miami. Please visit:  http://www.stalbanschildcare.org</p>
			</div>
		</div>
			<div class="charity">
			<div class="image-container" style="background-image:url(/ae92e446a35793d557befc962e7433d3.png);">
			</div>
			<div class="content-container">
				<p>We all remember being young and wanting to meet or do something special and not knowing if it will every happen. Many of the children that MAWC help aren’t sure if they will be able to do things for far more serious and challenging reasons than many of us can imagine. Please do what you can to Make a Wish come true. Please visit: http://sfla.wish.org/ways-to-help/giving/make-a-wish champions</p>
			</div>
		</div>
		</div>
